import "./App.css";
import React, { useEffect, useState } from "react";
function App() {




  const [data, setData] = useState("");
  // call fetch data function on initialization
  useEffect(() => {
    async function fetchData() {
      let response = await fetch(
        "https://api.openweathermap.org/data/2.5/forecast?q=smederevska%20palanka&units=metric&appid=" + process.env.REACT_APP_API_KEY
      );
      let data = await response.json();
      setData(data.list);
    }
    fetchData();

  }, []);

  return <div className="App">

    {console.log(data)}
  </div>
}

export default App;
